// src/components/UserProfile.js
import React from 'react';
import './css/UserProfile.css';
import profilePicture from '../assets/profile-picture.jpg';

const UserProfile = () => {
  const user = {
    name: 'John Doe',
    email: 'john.doe@example.com',
    level: 'Intermediate',
    exercisesCompleted: 45,
    totalExercises: 60,
    profilePicture: profilePicture,
  };

  const progressPercentage = (user.exercisesCompleted / user.totalExercises) * 100;

  return (
    <div className="user-profile">
      <div className="profile-header">
        <img src={user.profilePicture} alt="User Profile" className="profile-picture" />
        <h2>{user.name}</h2>
        <p>{user.email}</p>
        <p>Learning Level: {user.level}</p>
      </div>

      <div className="progress-section">
        <h3>Learning Progress</h3>
        <div className="progress-bar">
          <div
            className="progress-bar-fill"
            style={{ width: `${progressPercentage}%` }}
          ></div>
        </div>
        <p>
          {user.exercisesCompleted} of {user.totalExercises} exercises completed
        </p>
      </div>
    </div>
  );
};

export default UserProfile;
